import React from 'react';
import ReactDOM from 'react-dom';
import {
    View,
    Panel,
    PanelHeader,
    PanelHeaderBack,
    Card,
    CardGrid,
    Text
} from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

class Courier extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            activeView: ''
        }
    }

    render() {
        return(
            <div>
                <CardGrid style={{marginTop: 50}}>
                    <Text>Заказ №00000</Text>
                    <Card size="l" mode="shadow">
                        <div style={{ height: 96 }} />
                    </Card>
                </CardGrid>
                <CardGrid style={{marginTop: 50}}>
                    <Text>Заказ №00000</Text>
                    <Card size="l" mode="shadow">
                        <div style={{ height: 96 }} />
                    </Card>
                </CardGrid>
                <CardGrid style={{marginTop: 50}}>
                    <Text>Заказ №00000</Text>
                    <Card size="l" mode="shadow">
                        <div style={{ height: 96 }} />
                    </Card>
                </CardGrid>
            </div>
        );
    }
}

export default Courier;
